import React from 'react';
import { Panel, PanelHeader, Group, Div, Button} from '@vkontakte/vkui';

const Home = props => (
    <Panel id={props.id}>
        <PanelHeader>Заголовок</PanelHeader>
        Основная часть

        {props}

        <Group title="Меню">
            <Div>
                <Button size="xl" level="secondary" onClick={props.go} data-to="info">
                    Информация
                </Button>
            </Div>
        </Group>
    </Panel>
);

export default Home;
